export default function Fetched({ fetchedKeys, fetchedValues }) {
	return(
		<div className='fetched'>
			<div className='fetched-keys'>
				{fetchedKeys.map(i => {
					return(
						<li className='fetched-item' key={i}>{i}:</li>
					)

					})

				}
			</div>
			<div className='fetched-values'>
				{fetchedValues.map(i => {
					return(
						<li className='fetched-item' key={i}>{i}</li>
					)

					})

				}
			</div>
		</div>
	)
}
